INSERT INTO `his_config_info` VALUES (2284, 3302, 'com.erahub.biz.finance.api.RemoteFinanceERPProjectService:::provider:erahub-biz', 'DUBBO_GROUP', '', '{\"annotations\":[],\"canonicalName\":\"com.erahub.biz.finance.api.RemoteFinanceERPProjectService\",\"codeSource\":\"file:/E:/Program/java/project/erahub-auth-simple/erahub-auth-simple/erahub-api/erahub-api-biz/target/classes/\",\"methods\":[{\"annotations\":[],\"name\":\"clearTempFiles\",\"parameterTypes\":[],\"parameters\":[],\"returnType\":\"void\"}],\"parameters\":{\"side\":\"provider\",\"interface\":\"com.erahub.biz.finance.api.RemoteFinanceERPProjectService\",\"anyhost\":\"true\",\"pid\":\"27852\",\"application\":\"erahub-biz\",\"metadata-type\":\"remote\",\"release\":\"3.1.4\",\"dubbo\":\"2.0.2\",\"methods\":\"clearTempFiles\",\"logger\":\"slf4j\",\"deprecated\":\"false\",\"service-name-mapping\":\"true\",\"register-mode\":\"instance\",\"qos.enable\":\"false\",\"generic\":\"false\",\"bind.port\":\"20881\",\"bind.ip\":\"192.168.56.1\",\"background\":\"false\",\"dynamic\":\"true\",\"timestamp\":\"1675850612843\"},\"types\":[{\"enums\":[],\"items\":[],\"properties\":{},\"type\":\"void\"}],\"uniqueId\":\"com.erahub.biz.finance.api.RemoteFinanceERPProjectService@file:/E:/Program/java/project/erahub-auth-simple/erahub-auth-simple/erahub-api/erahub-api-biz/target/classes/\"}', 'c13261b9eac220a62835f2e212fb28c0', '2023-02-10 19:51:24', '2023-02-10 11:51:24', NULL, '192.168.56.1', 'U', 'dev', '');
